import React, { useContext } from 'react';
import { ContextGlobal } from '';

const Footer = () => {
  const { theme } = useContext(ContextGlobal);

  return (
    <footer className={theme === 'dark' ? 'dark' : ''}>
      <p>Powered by</p>
      <img src="./img/DH.png" alt='DH-logo' />
    </footer>
  );
};

export default Footer;
